  return (
    <div className="App">
      <Router>
        <Home />
        <Routes>
          {/* <Route path="/register" element={<Register />} /> */}
          <Route path="/admin" element={<Admin />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
